window.bookSummaryJSON = "<p><b>Finding my fated mate could bring death...or worse.</b></p> <p>After years of constant criticism, I finally escape the alpha of the strongest pack - my father. It’s a chance to have a new beginning and to live on my own terms, in my own way.</p> <p>The first day at college, I find more than what I bargained for.</p> <p>My fated mate.</p> <p>Something that any wolf rejoices in finding. Except, he’s forbidden - a human. The weakest race on Earth and someone my father would kill without any hesitation.</p> <p>Choices must be made, and loyalties will be tested. With everything on the brink of destruction, only one thing is certain: My life will never be the same.</p>"; 
